import "./App.css";

function App() {
  const users = [
    { name: "Najad", age: 26 },
    { name: "Hanad", age: 24 },
    { name: "Ahmed", age: 20 },
  ];

  return (
    <div className="App">
      {users.map((user, key) => {
        return (
          <>
            <h1 key={key}>
              {user.name} , {user.age}
            </h1>
          </>
        );
      })}
    </div>
  );
}


const User = (props) => {
  <h1>{props.name}</h1>
} 

export default App;
